INSERT INTO `ipquestion` VALUES (1,1,'A man-in-the-middle attack happens when an attacker intercepts communication and spoofs the identities of either of the two parties involved. How can such an attack be effectively countered?','Such an attack can be countered by a cyclic redundancy check (CRC). ','Such an attack can be countered by having an authentication through a digital signature before accepting someone\'s public key.','Such an attack can be countered by using a parity bit. ','Such an attack can be countered by using hashing algorithms.','Such an attack can be countered by having an authentication through a digital signature before accepting someone\'s public key.',3,11,2,1,1,2),(2,1,'When a mirror port is prepared to allow a LAN analyzer to be used for measurement in order to investigate the cause of a network failure, which of the following is a point to consider?','In preparation for a failure, it is necessary to inform network users of the storage location and usage method about the LAN analyzer.','Since the LAN analyzer can display the packets that pass through the network, it is necessary to pay attention to misuse or abuse, such as wiretapping.','Since LAN cables must be temporarily disconnected during measurement, it is necessary to give network users advance notice of the measurement date and time. ','Since the LAN analyzer disposes of packets, it is necessary to restrict the use of the non-target computers during measurement.  ','Since the LAN analyzer can display the packets that pass through the network, it is necessary to pay attention to misuse or abuse, such as wiretapping.',4,12,1,2,2,1),(3,63,'Which of the following is an appropriate explanation of monitoring in internal control? ','It is a process of continuously evaluating if internal control is working effectively. ','It is a process of promoting compliance to the laws and other regulations concerning internal control. ','It is a process of establishing an organization for internal control. ','It is a process of analyzing the risks that hinder internal control. ','It is a process of continuously evaluating if internal control is working effectively. ',5,13,2,1,1,2),(4,2,' Japanese restaurants in Sapporo and Japanese restaurants in Hakodate are to be searched for together. Which of the following is the logical expression that represents the search condition? ','(“Sapporo” AND “Hakodate”) AND “Japanese restaurant” ','(“Sapporo” AND “Hakodate”) OR “Japanese restaurant” ','(“Sapporo” OR “Hakodate”) AND “Japanese restaurant” ','(“Sapporo” OR “Hakodate”) OR “Japanese restaurant” \n \n','(“Sapporo” OR “Hakodate”) AND “Japanese restaurant” ',5,14,3,1,1,3),(5,5,'Which of the following is an appropriate description concerning machine language? \n','A program that is written in Fortran or C is converted into machine language and then executed. ','Machine language is a high-level language. ','Machine language expresses a program with sequences of decimal numbers. ','Most of application software is still programmed in machine language. ','A program that is written in Fortran or C is converted into machine language and then executed. ',5,15,3,1,1,3),(6,7,'In a markup language, with the purpose of displaying on a screen and printing, it is possible to directly embed not only the document content, but also the document structure and layout information, and the character font and size information. Which of the following is classified into such a markup language? ','C','HTML','SQL ','URL','HTML',5,16,3,1,1,3),(7,9,'On a desk that is only large enough to place four (4) files at the same time, six (6) files, A through F, are used to perform a task. When four (4) files are already placed on the desk, the least recently used file must be placed back into the drawer before the fifth file is placed on the desk. When the files are used in the sequence A, B, C, D, B, A, E, A, B, F, which of the following is the last file placed back into the drawer?','A ','B ',' D ',') E ',' D ',5,17,3,1,1,3),(8,10,'When USB memory or other such external recordable media is connected to a PC, which of the following is an OS function that automatically executes programs or plays movies on the media and can also cause malware infection? ',' Autocorrect ','Autocomplete','Auto filter ','Autorun','Autorun',5,18,3,1,1,3),(9,11,'Which of the following is the most appropriate description concerning deep learning? ','It is a method for studying according to proficiency level that uses textbooks published on the Internet and is not restricted by geographical location nor time. ','A computer analyzes a large volume of data, finds patterns, and makes inferences or decisions by itself by using a neural network. ','An appropriate response is provided based on specialist knowledge in specific fields that are systematically categorized.','The level of difficulty and the knowledge and skills required of each individual to solve problems are estimated according to his/her proficiency level and understanding. \n \n','A computer analyzes a large volume of data, finds patterns, and makes inferences or decisions by itself by using a neural network. ',5,19,3,1,1,3),(10,12,'Which of the following is an appropriate description concerning a device driver that enables the use of peripheral devices with a PC? ','When a hard disk drive is initialized and the operating system is reinstalled, it is necessary to reinstall device drivers that were installed separately to the operating system. ','When new application software is installed, it is necessary to reinstall all device drivers that this software uses. ','Even if a device driver is no longer required, a user cannot delete the device driver once it is installed. ','It is only necessary to install one (1) device driver for a printer to use all printers regardless of manufacturer or model. ','When a hard disk drive is initialized and the operating system is reinstalled, it is necessary to reinstall device drivers that were installed separately to the operating system. ',5,20,3,1,1,3),(11,13,'Which of the following is a description about a technology that improves the processing performance of a computer and is also called turbo boost? ','It is placed between the CPU and the main memory, and it remedies the slow performance of the main memory in reading and writing. ','It increases the operation frequency of the cores when the heat that the CPU generates and the power that the CPU consumes have certain margins against their limits. ','It provides multiple sections that serve as cores for performing calculations within the CPU, and it executes several processes simultaneously. ','It shares the CPUs of multiple computers, and executes a large amount of processes in a distributed manner. ','It increases the operation frequency of the cores when the heat that the CPU generates and the power that the CPU consumes have certain margins against their limits. ',5,21,3,1,1,3),(12,14,'Two (2) HDDs are connected to a server for storing data. When at least one (1) of the HDDs is working, stored data needs to be available. Which of the following is an appropriate configuration that should be used for the HDDs? ','Striping','Data mining ','Tethering ','Mirroring ','Mirroring ',5,22,3,1,1,3),(13,15,'Which of the following is an appropriate explanation of parallel processing? ','It is the division of a series of processing into processing units that can be executed simultaneously, and the execution of these on multiple CPUs. ','It is the execution of multiple related processes that are grouped together as a single process. ','It is the performing of business logic and database processes on the server side, and the performing of user interface processes on the client side. ','It is the division of processing time for a single CPU into short units, and the sequential allocation of these to multiple applications for execution. ','It is the division of a series of processing into processing units that can be executed simultaneously, and the execution of these on multiple CPUs. ',5,23,3,1,1,3),(14,16,'Which of the following includes all the appropriate measures to enable the execution of processing even in the event of a failure in part of a system? \n (1)	Configuring HDDs with mirroring \n(2)	Minimizing the frequency of maintenance and inspections after stable operation of the system starts\n(3)	Grouping multiple redundant network lines into a single high-speed line \n(4)	Making power supply redundant with the use of an uninterruptible power supply (UPS) etc. ','(1), (3) ','(1), (4) ','(2), (3) ','(2), (4) ','(1), (4) ',5,24,3,1,1,3),(15,18,'Among the descriptions A through C below concerning Open Source Software (OSS), which of the following is the list that contains all and only the appropriate descriptions? \nA: Source code can be modified and redistributed. \nB: It is free to obtain source code, but maintenance support for a fee must be used. \nC: The copyright is waived, and it can be used without permission. \n','A ',' A, C ','B','C ','A',5,25,3,1,1,3),(16,21,'Which of the following is a web browser that is Open Source Software (OSS)? ','Apache ','Firefox ','Linux ','Thunderbird ','Firefox ',5,26,3,1,1,3),(17,22,'Which of the following is an OS function that executes multiple application programs concurrently on a single PC, such as when a file is downloaded from a website while data is processed with spreadsheet software? ','Virtual reality ','Dual core ','Dual system ','Multitasking ','Multitasking ',5,27,3,1,1,3),(18,23,'Which of the following is an explanation of the printing method of an inkjet printer? ','Printing is performed by directly spraying fine ink particles onto the paper. ','Printing is performed by using printing pins or other such component to hit an ink ribbon against the paper. ','Printing is performed by using the print head to heat ink that melts when it is heated. ','Printing is performed by using laser light to make toner adhere to a photosensitive body. ','Printing is performed by directly spraying fine ink particles onto the paper. ',5,28,3,1,1,3),(19,24,'Which of the following is the copyright protection technology that is used for a DVD-R and an SD card, and allows digital content to be duplicated to recording media only once? ',' AR 	',' CPRM 	',' HDMI 	','MIDI ',' CPRM 	',5,29,3,1,1,3),(20,25,'Which of the following is the unit that represents the resolution when a photograph or a picture is read by a scanner? ','dpi 	 		',' fps',' pixel ',' ppm ','dpi ',5,30,3,1,1,3),(21,27,'Which of the following is a language used for the operation of a relational database? ','FAQ 			',' SQL ','SSL ','UML ',' SQL ',5,31,5,1,1,3),(22,28,'Which of the following is an appropriate description concerning foreign keys in a relational database? ','A property held by the foreign key is called a unique constraint. \n\n\n\n \n','Duplicate values cannot be set in the fields that are set as foreign keys. ','Multiple foreign keys can be defined in a single table. ','Multiple fields cannot be collectively set as a single foreign key. ','Multiple foreign keys can be defined in a single table. ',5,32,5,1,1,3),(23,29,'When designing a database, which of the following is used for the purpose of organizing and representing the relation of data? ',' E-R diagram 	\n\n',' Arrow diagram ',' Gantt chart 	',' Flowchart ','E-R diagram ',5,33,5,1,1,3),(24,31,'When another network such as the Internet is accessed from a network in an office or a household, which of the following fulfills the role of an entrance or an exit to the other network? 	',' Splitter 	\n	\n',' Default gateway ',' Hub 	',' Repeater ',' Default gateway ',5,34,3,1,1,3),(25,32,'Which of the following is an appropriate description concerning encryption of communication when a website with the URL beginning with “https://” is browsed through a PC browser? ','Only the communication from the PC to the web server is encrypted. \n \n\n\n','Only the communication from the web server to the PC is encrypted.','The bi-directional communication between the web server and PC is encrypted. ','The direction in which communication will be encrypted depends on the settings of the web server. ','The bi-directional communication between the web server and PC is encrypted. ',5,35,3,1,1,3),(26,33,'When transmitted over the Internet, data is divided into blocks, each of which is transmitted with a header that specifies the destination, the block number, and an error detecting code. Which of the following is the term for such blocks of data? ','Domain ','Packet 	','Port 	',' Router ','Packet 	',5,36,3,1,1,3),(27,34,'A DHCP server has been installed in a LAN. When a PC that automatically acquires information from the DHCP server is to be connected to the LAN, which of the following will be set in the PC? ','IP address \n\n\n','Latest virus definition file \n ','Address list of spam mail','Mail addresses assigned by the Internet service provider ','IP address ',5,37,3,1,1,3),(28,35,'Which of the following is the appropriate example of biometric authentication? ','Displaying an image of characters that are difficult for a machine to read on a monitor, and having a person read the characters and enter them \n\n\n\n','Having a person enter a password via a software keyboard that is displayed on a touch panel ','Reading the trail, pressure, and other characteristics of the action when a touch pen is used for a signature ','Having a person answer a question that only the person knows the answer to ','Reading the trail, pressure, and other characteristics of the action when a touch pen is used for a signature ',5,38,3,1,1,3),(29,36,'When a document file attached to a received e-mail is opened on a PC, the PC begins to behave abnormally. Which of the following is an appropriate suspected attack? ',' SQL injection 	\n	 \n \n',' Cross-site scripting ','Shoulder hacking ','Macro virus','Macro virus',5,39,3,1,1,3),(30,37,'Which of the following is the activity in A (Act) phase in the PDCA model adopted in an organization that operates an ISMS? ','Deciding to make improvements concerning matters such as flaws that are revealed through the monitoring of operational status and the measurement and evaluation of operational results \n\n\n','Monitoring operational status, and measuring and evaluating operational results \n','Creating a security policy, establishing an organizational structure, and creating a procedure for achieving the targets that are defined in the security policy ','Communicating the security policy to employees, installing security equipment and other security measures, and operating them ','Deciding to make improvements concerning matters such as flaws that are revealed through the monitoring of operational status and the measurement and evaluation of operational results ',5,40,3,1,1,3),(31,38,'Which of the following is an example of an aim of an attacker who infects someone else’s PC with ransomware? ','To obtain personal information on the PC via a network \n\n\n','To make files on the PC unusable, and to obtain money in exchange from unlocking them \n','To obtain characters typed with the PC keyboard via a network ','To operate the PC without the user’s permission by sending instructions for operations via a network ','To make files on the PC unusable, and to obtain money in exchange from unlocking them ',5,41,3,1,1,3),(32,39,'A private key and a public key were generated as a key pair and a digital certificate for the public key was issued. Which of the following is an appropriate action that should be taken when the private key is leaked? ','Reissuing the digital certificate with the same key pair \n\n\n\n','Requesting to the certification authority for revocation of the digital certificate ','Creating a new key pair for reissuing a certificate due to the expiration of the validity period ','Continuing using the same digital certificate, because only the private key was leaked ','Requesting to the certification authority for revocation of the digital certificate ',5,42,3,1,1,3),(33,40,'Which of the following sets conditions for character type, length, etc. used for passwords that are set for accounts on a computer, etc.? ','Single sign-on 	\n	\n',' Password crack ','Password policy 	','One-time password ','Password policy ',5,43,3,1,1,3),(34,41,'Among confidentiality, integrity, and availability, which of the following is the list that contains all and only the properties that are lost in the information security incident below? \nAll files on a server in the workplace were encrypted. However, the server was infected by a virus, and a number of the files were deleted. Removal of the virus and recovery of the files required several hours. During the hours, work could not be performed, and users were inconvenienced. Some files were unable to be recovered. \n','Confidentiality 	\n	\n',' Confidentiality, integrity ','Integrity, availability ',' Availability ','Integrity, availability ',5,44,3,1,1,3),(35,42,'A problem has been pointed out that the WEP encryption for wireless LANs can be broken easily. Which of the following is an encryption method that does not have the same weakness and is cryptographically stronger? ','ESSID \n	\n',' S/MIME ',' SSL 	',' WPA2 ',' WPA2 ',5,45,3,1,1,3),(36,43,'Company A implements risk analysis for its own information assets. The results show that if a nearby river overflows, the server room on the first floor of the company might be flooded. The company considers the possibility of moving the server room, but decides there is almost no risk of a flood because the last time the river overflowed was 100 years ago, and the management decides that no particular countermeasures are taken. Which of the following is the risk treatment for information security that Company A selects? ','Risk transfer 	\n	\n','Risk avoidance ',' Risk acceptance 	',' Risk mitigation ',' Risk acceptance 	',5,46,3,1,1,3),(37,44,'The decision is made to digitize a paper-based contact list that only some people are permitted to view, and to manage it as a contact file. Among the measures A through D below, which of the following is the list that contains all and only the appropriate measures against personal information leakage? \nA	A password for reading is set for the contact file. \nB	The contact file is encrypted.  \nC	The servers that stores the contact file are configured in a redundant configuration. \nD	After the contact list is digitized, the paper-based contact list is disposed of with a shredder. \n',' A, B 	 ',' A, B, C',' A, B, D 	',' C, D  ','A, B, D ',5,47,3,1,1,3),(38,45,'Among the Web browsing practices (1) through (3) below, which of the following is the list that contains all and only the practices that reduce security risks? \n(1)	Storing the user ID and the password on the web browser \n(2)	Disabling JavaScript \n(3)	Logging on to the PC with administrator privileges when using the web browser \n',' (1), (2) 	','(1), (3) 	',' (2) 	','(2), (3) ',' (2) 	',5,48,3,1,1,3),(39,47,'Which of the following corresponds to software maintenance? ','A response time that was measured in a system test did not satisfy the requirement, so tuning was performed on the software. \n\n','As a result of a software acceptance test, a defect was found, so the orderer requested the developer to fix the software. \n','A function was found missing in a unit test of a program, so the function was added to the program. ','A defect was reported on software that is running on a production system, so the software was modified. \n','A defect was reported on software that is running on a production system, so the software was modified. ',5,49,6,1,1,2),(40,48,'Which of the following is an appropriate test for a user to confirm by himself/herself whether the delivered software satisfies the requirements? ',' Acceptance test 	 \n	\n \n',' Integration test ','System test ',' Unit test ',' Acceptance test 	 ',5,50,6,1,1,2),(41,49,'A system migrati