INSERT INTO `question` VALUES (1,1,'Which of the following uses a flip-flop circuit in a memory cell?','DRAM','EEPROM','SDRAM','SRAM',NULL,NULL,NULL,NULL,NULL,'SRAM',1,1,3,1,1,3),(2,2,'Which of the following is an explanation of CRM?',' It is a concept to optimize customer loyalty by sharing information throughout all customer channels within a company and improving customer satisfaction by raising the level of service.','It is a business approach for significantly improving the efficiency of the entire supply chain through the real time exchange of information regarding production, inventory, procurement, sales, distribution, etc.',' It is a method for improving business efficiency by planning and managing business resources throughout the company effectively and comprehensively.','It is a method for wholesale dealers or manufacturers to increase business transactions with retail stores by supporting their business activities, and increasing their sales and profits.',NULL,NULL,NULL,NULL,NULL,' It is a concept to optimize customer loyalty by sharing information throughout all customer channels within a company and improving customer satisfaction by raising the level of service.',3,2,1,1,1,1),(3,3,'There are several formats for representing an integer in a computer. When a set of unsigned binary integers that are arranged in ascending order is interpreted in different formats and then sorted again in ascending order of their values, which of the following is the format that maintains the same order as the original unsigned binary integers? ','One’s complement format','Signed magnitude format ','Biased (i.e., offset binary) format ','Two’s complement format',NULL,NULL,NULL,NULL,NULL,'Biased (i.e., offset binary) format ',1,3,2,1,1,2),(4,4,'The figure below shows the work procedure for MRP (Material Requirements Planning), a technique pertaining to a production management system. Which of the following is a necessary piece of information for calculating the net requirements to be inserted into A in the figure below? ','Inventory status (inventory amount, residual orders, in-process quantity)\n\n','Bill of materials (configuration and requirements of each component in the final product) ','Ordering policy (lot organization method, ordering method, safety stock) \n\n','Standard schedule (completion period, number of days of lead time)',NULL,NULL,NULL,NULL,NULL,'Inventory status (inventory amount, residual orders, in-process quantity)\n\n',1,4,3,1,1,3),(6,1,'Which of the following is an appropriate description concerning the role of a system auditor? ','It is to assure the preparation and operations regarding the control of the information system or to give advice on these, from a standpoint of professional standpoint independent from the audit target.','It is to evaluate the performance of the information system and to issue an audit working paper to the system users. ','It is to instruct the testing staff to improve defects found during the comprehensive test for the information system. ','It is to test if processes are performed according to the plan and then to approve the release.',NULL,NULL,NULL,NULL,NULL,'It is to assure the preparation and operations regarding the control of the information system or to give advice on these, from a standpoint of professional standpoint independent from the audit target.',3,6,1,2,2,1),(7,2,'The logic circuit below shows a JK flip-flop. Which of the following is the appropriate truth table for the JK flip-flop. Here, the state of each output signal is affected only when the clock signal CLK changes from 0 to 1. “No Change” means that each output signal maintains its previous state, and “Toggle” means that each output signal switches (or toggles) its state “from 0 to 1” or “from 1 to 0.”','A','B','C','D',NULL,NULL,NULL,NULL,NULL,'C',3,7,1,2,2,1),(8,3,'Which of the following is an appropriate description of the effect of cache memory?','By reading data from main memory and storing it in cache memory, data transfer is performed at high speed when the CPU reads the same data later.','By reading data from main memory and storing it in cache memory, and then processing instructions in parallel in cache memory, operations are performed at high speed','By reading instructions and data simultaneously from main memory to cache memory, data transfer is performed at high speed.','By reading instructions from main memory and storing them in cache memory, and then decoding and executing them in cache memory, operations are performed at high speed.  ',NULL,NULL,NULL,NULL,NULL,'By reading data from main memory and storing it in cache memory, data transfer is performed at high speed when the CPU reads the same data later.',1,8,1,2,2,1),(9,4,'When a packet filtering firewall is installed at the point of connection between a company’s internal network and the Internet, and PCs on the company’s internal network are allowed to access port 80 of Web servers on the Internet, which of the following is an appropriate combination of rules for filtering to grant permission? ','A','B','C','D',NULL,NULL,NULL,NULL,NULL,'C',1,9,1,2,2,1),(10,5,'When a packet-filtering firewall is to be installed at the point of connection between a company’s internal network and the Internet, and PCs on the internal network are to be allowed to access port 80 of a web server on the Internet, which of the following is an appropriate combination of rules of filters for allowing traffic?\n\n','A','B','C','D',NULL,NULL,NULL,NULL,NULL,'A',3,10,1,2,2,1);
